import React from 'react';
import s from "./Events.module.css";
import Event from "./Event/Event";
const Events = ()=> {
    return(
        <div className={s.event}>
            <h1>EVENTS!</h1>
            <Event/>
            <Event/>
        </div>)
}

export default Events;
